B.a2k=new A.H("Der Konsum von Alkohol kann sehr schlimme bis hin zu fatalen Folgen haben und sollte auf keinen Fall untersch\xe4tzt werden! J\xe4hrlich sterben tausende Menschen an den Folgen \xfcberm\xe4\xdfigen Alkoholkonsums!\nNat\xfcrlich kann Anton Sagt auch ohne Alkohol gespielt werden und niemand soll zum Trinken animiert werden, der dies nicht m\xf6chte!\nKennt euer Limit und passt gut auf euch auf!","The consumption of alcohol can lead to severe and even fatal health issues and must not be underestimated! Every year thousands of people die due to the consequences of binge drinking!\nOf course Anton Sagt can be played without drinking alcoholic beverages and no one should be forced to drink, who does not want to!\nKnow your limits and be safe!",null,null,null)
