B.a2n=new A.H("Willkommen zum Race!\nUm den Hype f\xfcrs kommende Anton Sagt Release nochmal anzukurbeln, spielen wir ein paar Minispiele aus dem neuen \n1 GEGEN 1 MODUS!\n\nNormalerweise spielt man diese Spiele zu zweit auf einem Handy, und wer verliert, trinkt.\n\nHeute gibt es aber keine Verlierer*innen, denn wer die beste Zeit erreicht, gewinnt 50\u20ac!\n\nViel Erfolg!","Welcome to the Race!\nTo build hype for the upcoming Anton Sagt release, we're playing a few mini-games from the new \n1 VS 1 MODE!\n\nUsually, you'll play these games together on one phone with a friend, and the loser drinks.\n\nBut today, there are no loser, since the fastest player is going to win \u20ac50!\n\nGood luck!",null,null,null)
